import { Row } from 'react-bootstrap';
import './App.css';
import ListCategori from './components/ListCategori';
import NavbarComponent from './components/NavbarComponent';

function App() {
  return (
    <div className="App">
      <NavbarComponent/>
      <Row>
        <ListCategori/>
      </Row>
    </div>
  );
}

export default App;
